#
# View "choiceview"
#

CREATE
  ALGORITHM = UNDEFINED
  VIEW `choiceview`
  AS
  SELECT
    `choice`.`chid`,
    `choice`.`choicetime`,
    `choice`.`pid`,
    `post`.`wxid` AS 'towxid',
    `choice`.`wxid` AS 'bywxid',
    `choice`.`type`,
    `post`.`title`,
    `choice`.`isview`
  FROM
    ((`post`
      JOIN `choice`)
      JOIN `user`)
  WHERE
    ((`choice`.`pid` = `post`.`pid`) AND (`post`.`wxid` = `user`.`wxid`));

#
# View "commentbymyselfview"
#

CREATE
  ALGORITHM = UNDEFINED
  VIEW `commentbymyselfview`
  AS
  SELECT
    `comment`.`cid`,
    `comment`.`pid`,
    `post`.`title`,
    `comment`.`commentcontent`,
    `comment`.`commenttime`,
    `comment`.`wxid`,
    `user`.`nickname`
  FROM
    ((`post`
      JOIN `comment`)
      JOIN `user`)
  WHERE
    ((`post`.`pid` = `comment`.`pid`) AND (`user`.`wxid` = `comment`.`wxid`));

