#
# View "parentsview"
#

CREATE
  ALGORITHM = UNDEFINED
  VIEW `parentsview`
  AS
  SELECT
    `user`.`wxid`,
    `user`.`nickname`,
    `user`.`role`,
    `user`.`region`,
    `user`.`phonenum`,
    `user`.`forbidden`,
    `parents`.`purpose`
  FROM
    (`user`
      JOIN `parents`)
  WHERE
    (`user`.`wxid` = `parents`.`wxid`);

#
# View "studentview"
#

CREATE
  ALGORITHM = UNDEFINED
  VIEW `studentview`
  AS
  SELECT
    `user`.`wxid`,
    `user`.`nickname`,
    `user`.`role`,
    `user`.`region`,
    `user`.`phonenum`,
    `user`.`forbidden`,
    `student`.`school`,
    `student`.`topprize`,
    `student`.`identification`,
    `student`.`img`
  FROM
    (`user`
      JOIN `student`)
  WHERE
    (`user`.`wxid` = `student`.`wxid`);

